window.bookSummaryJSON = "<p>Number-one <i>New York Times</i> best-selling author Brad Thor returns with his latest action-packed Scot Harvath thriller.</p> <p>Across Europe, a secret organization has begun attacking diplomats. Back in the United States, a foreign ally demands the identity of a highly placed covert asset. In the balance hang the ingredients for all-out war.</p> <p>With his mentor out of the game, counterterrorism operative Scot Harvath must take on the role he has spent his career avoiding. But, as with everything else he does, he intends to rewrite the rules - all of them.</p> <p>In <i>Spymaster</i>, Scot Harvath is more cunning, more dangerous, and deadlier than ever before.</p> <p>If you have never listened to a Brad Thor novel, this is the place to start!</p>"; 
